import { Link } from "react-router-dom";

const SampleNav = () => {
    return ( 
        <div className="flex m-6 p-4 text-white font-extrabold">
        <div>
            <Link to={"/"}>Main</Link>
        </div>
        <div>
            <Link to={"/about"}>about</Link>
        </div>
        </div>
     );
}

export default SampleNav;
